import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
}
<app-nav-bar></app-nav-bar>

<div class="contentDiv">
  <h2 id="homeContent">
    Welcome!
    <app-server></app-server>
  </h2>
</div>
